import React from 'react';
import {BaseNode} from "./abstraction/base-node"
// import "../../../css/node.css"

export const EmptyNode = ({
    className,
    // onClick,
    ...props
}) =>(
    // onClick={onClick}
    <BaseNode className={className+ " node node-empty"} onClick={()=>{console.log("changed to weight node!")}} onDoubleClick={()=>{console.log("changed to additional destination node!")}} onMouseDown={()=> {console.log("mouse down!")}} onMouseMove={()=>{console.log("mouse moved!")}} {...props}>
    </BaseNode>
)
